static inline void bn512Shr2( bn512 *dst )
{
#if BN_UNIT_BITS == 64
  dst->unit[0] = ( dst->unit[0] >> 2 ) | ( dst->unit[1] << (BN_UNIT_BITS-2) );
  dst->unit[1] = ( dst->unit[1] >> 2 ) | ( dst->unit[2] << (BN_UNIT_BITS-2) );
  dst->unit[2] = ( dst->unit[2] >> 2 ) | ( dst->unit[3] << (BN_UNIT_BITS-2) );
  dst->unit[3] = ( dst->unit[3] >> 2 ) | ( dst->unit[4] << (BN_UNIT_BITS-2) );
  dst->unit[4] = ( dst->unit[4] >> 2 ) | ( dst->unit[5] << (BN_UNIT_BITS-2) );
  dst->unit[5] = ( dst->unit[5] >> 2 ) | ( dst->unit[6] << (BN_UNIT_BITS-2) );
  dst->unit[6] = ( dst->unit[6] >> 2 ) | ( dst->unit[7] << (BN_UNIT_BITS-2) );
  dst->unit[7] = ( dst->unit[7] >> 2 );
#else
  dst->unit[0] = ( dst->unit[0] >> 2 ) | ( dst->unit[1] << (BN_UNIT_BITS-2) );
  dst->unit[1] = ( dst->unit[1] >> 2 ) | ( dst->unit[2] << (BN_UNIT_BITS-2) );
  dst->unit[2] = ( dst->unit[2] >> 2 ) | ( dst->unit[3] << (BN_UNIT_BITS-2) );
  dst->unit[3] = ( dst->unit[3] >> 2 ) | ( dst->unit[4] << (BN_UNIT_BITS-2) );
  dst->unit[4] = ( dst->unit[4] >> 2 ) | ( dst->unit[5] << (BN_UNIT_BITS-2) );
  dst->unit[5] = ( dst->unit[5] >> 2 ) | ( dst->unit[6] << (BN_UNIT_BITS-2) );
  dst->unit[6] = ( dst->unit[6] >> 2 ) | ( dst->unit[7] << (BN_UNIT_BITS-2) );
  dst->unit[7] = ( dst->unit[7] >> 2 ) | ( dst->unit[8] << (BN_UNIT_BITS-2) );
  dst->unit[8] = ( dst->unit[8] >> 2 ) | ( dst->unit[9] << (BN_UNIT_BITS-2) );
  dst->unit[9] = ( dst->unit[9] >> 2 ) | ( dst->unit[10] << (BN_UNIT_BITS-2) );
  dst->unit[10] = ( dst->unit[10] >> 2 ) | ( dst->unit[11] << (BN_UNIT_BITS-2) );
  dst->unit[11] = ( dst->unit[11] >> 2 ) | ( dst->unit[12] << (BN_UNIT_BITS-2) );
  dst->unit[12] = ( dst->unit[12] >> 2 ) | ( dst->unit[13] << (BN_UNIT_BITS-2) );
  dst->unit[13] = ( dst->unit[13] >> 2 ) | ( dst->unit[14] << (BN_UNIT_BITS-2) );
  dst->unit[14] = ( dst->unit[14] >> 2 ) | ( dst->unit[15] << (BN_UNIT_BITS-2) );
  dst->unit[15] = ( dst->unit[15] >> 2 );
#endif
  return;
}


void bn512Sqrt( bn512 *dst, const bn512 * const src, bnShift shift )
{
  int msb, oneshift;
  bn512 base, one, tmp;

  bn512Set( &base, src );
  bn512Zero( dst );
  msb = bn512GetIndexMSB( &base );
  oneshift = ( msb & ~0x1 ) | ( shift & 0x1 );
  bn512Zero( &one );
  bn512SetBit( &one, oneshift );
  for( ; bn512CmpGt( &one, &base ) ; )
  {
    oneshift -= 2;
    bn512Shr2( &one );
  }
  for( ; ; )
  {
    bn512SetOr( &tmp, dst, &one );
    bn512Shr1( dst );
    if( bn512CmpGe( &base, &tmp ) )
    {
      bn512Sub( &base, &tmp );
      bn512Or( dst, &one );
    }
    if( oneshift < 2 )
    {
      if( shift < 2 )
        break;
      shift -= 2;
      bn512Shl( dst, dst, 2 );
      bn512Shl( &base, &base, 2 );
    }
    else
    {
      oneshift -= 2;
      bn512Zero( &one );
      bn512SetBit( &one, oneshift );
    }
  }
  if( bn512CmpGt( &base, dst ) )
    bn512Add32( dst, 1 );

  return;
}


void bn512Log( bn512 *dst, const bn512 * const src, bnShift shift )
{
  int divisor;
  bn512 one, limit, base, fsub, fadd, part, bnlog, tmp;
#ifndef BN512_USE_INVERSE_DIVISION
  bn512 factor;
#endif

  bn512Zero( dst );
  if( bn512CmpNegative( src ) )
    return;
  bn512Set( &base, src );
  bn512Set32Shl( &one, 1, shift );
  if( bn512CmpGt( &base, &one ) )
  {
    bn512Set32Shl( &limit, 2, shift-0 );
    if( bn512CmpGt( &base, &limit ) )
    {
      bn512ShrRound( &bnlog, &bn512Log2, BN512_LOG2_SHIFT - shift );
      do
      {
        bn512Add( dst, &bnlog );
        bn512Shr1( &base );
      } while( bn512CmpGt( &base, &limit ) );
    }
    bn512Set32Shl( &limit, 33, shift-5 );
    if( bn512CmpGt( &base, &limit ) )
    {
      bn512ShrRound( &bnlog, &bn512Log1p0625, BN512_LOG1P0625_SHIFT - shift );
      do
      {
        bn512Add( dst, &bnlog );
        bn512MulShr( &tmp, &bn512Div1p0625, &base, BN512_DIV1P0625_SHIFT );
        if( bn512CmpEq( &base, &tmp ) )
          break;
        bn512Set( &base, &tmp );
      } while( bn512CmpGt( &base, &limit ) );
    }
  }
  else
  {
    bn512Set32Shl( &limit, 1, shift-1 );
    if( bn512CmpLt( &base, &limit ) )
    {
      bn512ShrRound( &bnlog, &bn512Log2, BN512_LOG2_SHIFT - shift );
      do
      {
        bn512Sub( dst, &bnlog );
        bn512Shl1( &base );
      } while( bn512CmpLt( &base, &limit ) );
    }
    bn512Set32Shl( &limit, 31, shift-5 );
    if( bn512CmpLt( &base, &limit ) )
    {
      bn512ShrRound( &bnlog, &bn512Log1p0625, BN512_LOG1P0625_SHIFT - shift );
      do
      {
        bn512Sub( dst, &bnlog );
        bn512MulShr( &tmp, &bn512Mul1p0625, &base, BN512_MUL1P0625_SHIFT );
        if( bn512CmpEq( &base, &tmp ) )
          break;
        bn512Set( &base, &tmp );
      } while( bn512CmpLt( &base, &limit ) );
    }
  }

  bn512Sub( &base, &one );
  bn512SquareShr( &fsub, &base, shift );
  bn512Add( dst, &base );
  for( divisor = 2 ; divisor < BN512_DIV_TABLE_SIZE ; divisor += 2 )
  {
#ifdef BN512_USE_INVERSE_DIVISION
    bn512MulSignedShr( &part, &bn512DivFactor[divisor+0], &fsub, BN512_DIV_SHIFT );
#else
    bn512Set( &factor, &one );
    bn512Div32Round( &factor, divisor+0 );
    bn512MulSignedShr( &part, &factor, &fsub, shift );
#endif
    bn512Sub( dst, &part );
    bn512MulSignedShr( &fadd, &fsub, &base, shift );
    if( bn512CmpEqOrZero( &fadd, &fsub ) )
      break;
#ifdef BN512_USE_INVERSE_DIVISION
    bn512MulSignedShr( &part, &bn512DivFactor[divisor+1], &fadd, BN512_DIV_SHIFT );
#else
    bn512Set( &factor, &one );
    bn512Div32Round( &factor, divisor+1 );
    bn512MulSignedShr( &part, &factor, &fadd, shift );
#endif
    bn512Add( dst, &part );
    bn512MulSignedShr( &fsub, &fadd, &base, shift );
    if( bn512CmpEqOrZero( &fsub, &fadd ) )
      break;
  }
#ifdef BN512_PRINT_REPORT
  printf( "Log Iteration Count : %d\n", (divisor-2)/2 );
#endif

  return;
}


void bn512Exp( bn512 *dst, const bn512 * const src, bnShift shift )
{
  int divisor, factorflag;
  bn512 term0, term1, one, factor, tmp, base, limit, bnexp, div8;

  bn512Set32Shl( &one, 1, shift );
  bn512Set( &base, src );

  factorflag = 0;
  bn512Set( &factor, &one );
  if( bn512CmpPositive( &base ) )
  {
    bn512Set( &limit, &one );
    if( bn512CmpGt( &base, &limit ) )
    {
      bn512ShrRound( &bnexp, &bn512Exp1, BN512_EXP1_SHIFT - shift );
      factorflag = 1;
      do
      {
        if( bn512MulCheckShr( &tmp, &factor, &bnexp, shift ) )
        {
          bn512Set( dst, &bn512InfPos );
          return;
        }
        bn512Set( &factor, &tmp );
        bn512Sub( &base, &one );
      } while( bn512CmpGt( &base, &limit ) );
    }
  }
  else
  {
    bn512Zero( &limit );
    if( bn512CmpSignedLt( &base, &limit ) )
    {
      bn512ShrRound( &bnexp, &bn512Exp1Inv, BN512_EXP1INV_SHIFT - shift );
      factorflag = 1;
      do
      {
        bn512MulShr( &tmp, &factor, &bnexp, shift );
        if( bn512CmpZero( &tmp ) )
        {
          bn512CmpZero( dst );
          return;
        }
        bn512Set( &factor, &tmp );
        bn512Add( &base, &one );
      } while( bn512CmpSignedLt( &base, &limit ) );
    }
  }

  bn512Set32Shl( &limit, 1, shift-4 );
  if( bn512CmpSignedGt( &base, &limit ) )
  {
    bn512Set32Shl( &div8, 1, shift-3 );
    if( bn512CmpNotZero( &div8 ) )
    {
      bn512ShrRound( &bnexp, &bn512Exp0p125, BN512_EXP0P125_SHIFT - shift );
      factorflag = 1;
      do
      {
        if( bn512MulCheckShr( &tmp, &factor, &bnexp, shift ) )
        {
          bn512Set( dst, &bn512InfPos );
          return;
        }
        bn512Set( &factor, &tmp );
        bn512Sub( &base, &div8 );
      } while( bn512CmpSignedGt( &base, &limit ) );
    }
  }

  bn512SetAdd( dst, &one, &base );
  bn512Set( &term0, &base );
  for( divisor = 2 ; divisor < BN512_DIV_TABLE_SIZE ; divisor += 2 )
  {
#ifdef BN512_USE_INVERSE_DIVISION
    bn512MulSignedShr( &tmp, &bn512DivFactor[divisor+0], &base, BN512_DIV_SHIFT );
#else
    bn512Set( &tmp, &base );
    bn512Div32RoundSigned( &tmp, divisor+0 );
#endif
    bn512MulSignedShr( &term1, &tmp, &term0, shift );
    if( bn512CmpEqOrZero( &term1, &term0 ) )
      break;
    bn512Add( dst, &term1 );
#ifdef BN512_USE_INVERSE_DIVISION
    bn512MulSignedShr( &tmp, &bn512DivFactor[divisor+1], &base, BN512_DIV_SHIFT );
#else
    bn512Set( &tmp, &base );
    bn512Div32RoundSigned( &tmp, divisor+1 );
#endif
    bn512MulSignedShr( &term0, &tmp, &term1, shift );
    if( bn512CmpEqOrZero( &term0, &term1 ) )
      break;
    bn512Add( dst, &term0 );
  }
  if( factorflag )
  {
    bn512MulSignedShr( &tmp, &factor, dst, shift );
    bn512Set( dst, &tmp );
  }
#ifdef BN512_PRINT_REPORT
  printf( "Exp Iteration Count : %d\n", (divisor-2)/2 );
#endif

  return;
}


void bn512Pow( bn512 *dst, const bn512 * const src, const bn512 * const exponent, bnShift shift )
{
  bn512 tmp, expf;
  bn512Log( &tmp, src, shift );
  bn512MulSignedShr( &expf, &tmp, exponent, shift );
  bn512Exp( dst, &expf, shift );
  return;
}


void bn512PowInt( bn512 *dst, const bn512 * const src, uint32_t exponent, bnShift shift )
{
  uint32_t exlevel, mulflag;
  bn512 tmp, mul;
  if( exponent == 0 )
  {
    bn512Set32Shl( dst, 1, shift );
    return;
  }
  mulflag = 0;
  bn512Set( &mul, src );
  exlevel = 1;
  for( ; ; )
  {
    if( exponent & exlevel )
    {
      if( !( mulflag ) )
      {
        bn512Set( dst, &mul );
        mulflag = 1;
      }
      else
      {
        bn512MulSignedShr( &tmp, dst, &mul, shift );
        bn512Set( dst, &tmp );
      }
      exponent -= exlevel;
      if( !( exponent ) )
        break;
    }
    exlevel <<= 1;
    bn512SquareShr( &tmp, &mul, shift );
    bn512Set( &mul, &tmp );
  }
  return;
}


void bn512Cos( bn512 *dst, const bn512 * const src, bnShift shift )
{
  int divisor, negflag, divproduct, msbdiff;
  bn512 term0, term1, one, tmp, tmp2, base, bn2pi, bnpi, bnhpi, basesq, rem;

  if( bn512CmpPositive( src ) )
    bn512Set( &base, src );
  else
    bn512SetNeg( &base, src );
  bn512ShrRound( &bn2pi, &bn512Pi, BN512_PI_SHIFT-1 - shift );
  if( bn512CmpGt( &base, &bn2pi ) )
  {
    msbdiff = bn512GetIndexMSB( &base ) - bn512GetIndexMSB( &bn2pi );
    if( msbdiff >= 3 )
    {
      bn512Div( &base, &bn2pi, &rem );
      bn512Set( &base, &rem );
    }
    else
    {
      for( ; bn512CmpGt( &base, &bn2pi ) ; )
        bn512Sub( &base, &bn2pi );
    }
  }
  bn512ShrRound( &bnpi, &bn512Pi, BN512_PI_SHIFT+0 - shift );
  if( bn512CmpGt( &base, &bnpi ) )
  {
    bn512SetSub( &tmp, &bn2pi, &base );
    bn512Set( &base, &tmp );
  }
  negflag = 0;
  bn512ShrRound( &bnhpi, &bn512Pi, BN512_PI_SHIFT+1 - shift );
  if( bn512CmpGt( &base, &bnhpi ) )
  {
    bn512SetSub( &tmp, &bnpi, &base );
    bn512Set( &base, &tmp );
    negflag = 1;
  }

  bn512Set32Shl( &one, 1, shift );
  bn512SquareShr( &basesq, &base, shift );
  bn512Set( dst, &one );
  bn512SetShr1( &term0, &basesq );
  bn512Sub( dst, &term0 );
  for( divisor = 4 ; divisor < BN512_DIV_TABLE_SIZE ; divisor += 4 )
  {
#ifdef BN512_USE_INVERSE_DIVISION
    divproduct = (divisor-1) * (divisor+0);
    if( divproduct < BN512_DIV_TABLE_SIZE )
      bn512MulShr( &tmp, &basesq, &bn512DivFactor[divproduct], BN512_DIV_SHIFT );
    else
    {
      bn512MulShr( &tmp2, &bn512DivFactor[divisor-1], &bn512DivFactor[divisor+0], BN512_DIV_SHIFT );
      bn512MulShr( &tmp, &basesq, &tmp2, BN512_DIV_SHIFT );
    }
#else
    bn512Set( &tmp, &basesq );
    bn512Div32Round( &tmp, (divisor-1)*(divisor+0) );
#endif
    bn512MulShr( &term1, &tmp, &term0, shift );
    if( bn512CmpEqOrZero( &term1, &term0 ) )
      break;
    if( bn512CmpZero( &term1 ) )
      break;
    bn512Add( dst, &term1 );
#ifdef BN512_USE_INVERSE_DIVISION
    divproduct = (divisor+1) * (divisor+2);
    if( divproduct < BN512_DIV_TABLE_SIZE )
      bn512MulShr( &tmp, &basesq, &bn512DivFactor[divproduct], BN512_DIV_SHIFT );
    else
    {
      bn512MulShr( &tmp2, &bn512DivFactor[divisor+1], &bn512DivFactor[divisor+2], BN512_DIV_SHIFT );
      bn512MulShr( &tmp, &basesq, &tmp2, BN512_DIV_SHIFT );
    }
#else
    bn512Set( &tmp, &basesq );
    bn512Div32Round( &tmp, (divisor+1)*(divisor+2) );
#endif
    bn512MulShr( &term0, &tmp, &term1, shift );
    if( bn512CmpEqOrZero( &term0, &term1 ) )
      break;
    bn512Sub( dst, &term0 );
  }
  if( negflag )
    bn512Neg( dst );
#ifdef BN512_PRINT_REPORT
  printf( "Cos Iteration Count : %d\n", (divisor-4)/4 );
#endif

  return;
}


void bn512Sin( bn512 *dst, const bn512 * const src, bnShift shift )
{
  bn512 bncos, bnhpi;
  bn512ShrRound( &bnhpi, &bn512Pi, BN512_PI_SHIFT+1 - shift );
  bn512SetSub( &bncos, src, &bnhpi );
  bn512Cos( dst, &bncos, shift );
  return;
}


void bn512Tan( bn512 *dst, const bn512 * const src, bnShift shift )
{
  bn512 bncos;
  bn512Cos( &bncos, src, shift );
  if( bn512CmpNotZero( &bncos ) )
  {
    bn512Sin( dst, src, shift );
    bn512DivRoundSignedShl( dst, &bncos, shift );
  }
  else
    bn512Set( dst, bn512CmpPositive( src ) ? &bn512InfPos : &bn512InfNeg );
  return;
}


